      <attributes id="10" justification="0" size="4" underlined="false">
        <text>- inspector1Times : String &quot;Filename for inspector1 times&quot;
- inspector2Times : String
- workstation1Times : String
- workstation2Times : String
- workstation3Times : String
+ clock : int &quot;Number of minutes that have passed&quot;
- FEL : Queue&lt;SimEvent&gt; &quot;Priority queue organized by time of event&quot;
- buffers : Component[5][2] &quot;5 buffers with max 2 C capacity&quot;
- isI1Busy : Boolean
- isI2Busy : Boolean
- isW1Busy : Boolean
- isW2Busy : Boolean
- isW3Busy : Boolean
- BI1 : double &quot;Blocking time of Inspector1&quot;
- BI2 : double &quot;Blocking time of Inspector2&quot;
- PI1 : double &quot;Blocking proportion of Inspector1&quot;
- PI2 : double &quot;Blocking proportion of Inspector2&quot;</text>
      </attributes>
      <methods id="11" justification="0" size="4" underlined="false">
        <text>- initialization() &quot;instantiate variables, setup FI event at inspectors 1 and 2&quot;
+ main(String[]) &quot;initialize Priority Queue FEL, run initialization(), while FEL !empty and clock &lt; chosenTime, take next event, check if null, set clock, processEvent()&quot;
- generateReport() &quot;print proportion of inspector idle time and # of products made&quot;
- processSI(Event) &quot;unnecessary&quot;
- processFI(Event) &quot;select buffer based on C id and policy. If buffer full block, if available record block time then send C to buffer. create FI event. create SA event&quot;
- processSA(Event) &quot;check if workstation busy, then consider three cases: Case1 buffer[0] create EA event immediately and remove C from buffer. Case2 buffer[1 or 2] check if neither buffer 1 or 2 are empty, if so create EA event. Case3 buffer[3 or 4] check if neither buffer 3 or 4 are empty, create EA event.&quot;
- processEA(Event) &quot;Increase associated product count by one, create SA event&quot;
- scheduleEvent(Event.eventType, Component) &quot;Called by process functions to schedule future events&quot;
- getNextTime(String) : int &quot;get next time from associated file.&quot;
- processEvent(Event) &quot;call process function passing Event depending upon eventType.&quot;</text>
